import React from 'react'
import './drop.css';
export default function Drop() {
  return <form method="post" action="#" id="#">
           
              
              
              
  <div class="form-group files"><center>    <label class="a">Upload Your File </label><br></br><br></br>
    <input type="file" class="form-control" multiple=""/></center>

  </div>
  

</form>
}
